export class Competence {
  name: string;
}

export class TechnicalSkill {
  id?: number;
  name: string;
  competences: Competence[];
  level?: string;
}

export class Proficiency {
  name: string;
}

export class Skill {
  id?: number;
  name: string;
}

export class AddedSkill {
  id?: number;
  skill: Skill;
  proficiency: Proficiency;
}

export class ProgrammingLanguage {
  id?: number;
  technicalSkill: TechnicalSkill;
  competence: Competence;
  proficiency: Proficiency;
}

export class Education {
  id?: number;
  university: string;
  major: string;
  from: string;
  to: string;
}

export class Certificate {
  id?: number;
  name: string;
  organization: string;
  issuedDate: string;
}

export class WorkingExperience {
  id?: number;
  companyName: string;
  position: string;
  from: string;
  to: string;
}

export class Project {
  id?: number;
  name: string;
  technology: string;
  description: string;
}

