  uploadFile(file: File) {
    const baseUrl = 'http://localhost:4200';
    const formData: any = new FormData();

    formData.append('file', file);

    return this.http.post(baseUrl + '/uploadFile', formData, {
      reportProgress: true,
      observe: 'events',
    });
  }

